postcontent:
Gorgeous Handmade Katana I have no use for anymore. $250
Steel: 1045 steel
Blade: heat tempered;
Edge: Sharp;
Hamon(Tempered line): Obvious Hamon,hand polished on;
Hi(Blood groove): Long Hi on each side;
Tsuka(Handle): Wood covered in genuine same (rayskin) & then wrapped in the traditional diamond pattern with black cotton Ito;
Saya: Black piano lacquered wood tied with black Japanese cotton Sageo;
Tang: Full tang, signed with smith's signature;
Tsuba: Butterfly tsuba;
Other Fittings: Brass;
Condition: Unused & can be fully disassembled and assembled
Handle Length: 11"
Blade Length(with Habaki): about 28.5"
Blade Length(without Habaki): about 27"
Overall Length: 41"
Sword Weight (with Saya): 2.7 lbs
Sword Weight(without Saya): 2.15 lbs
